import React, {Component} from 'react';
import {NavLink} from "react-router-dom";
import logo from '../logo.svg'
import {ButtonContainer} from "./Button";
import styled from 'styled-components';
import '../App.css';

const NavWrapper=styled.nav`
    background:var(--mainRed);
    .nav-link{
        color:var(--mainWhite) !important;
        font-size:1.3rem;
    }   
`;


export default class Navbar extends Component {

    render() {
        return (
          <NavWrapper className="navbar navbar-expand-sm navbar-dark px-sm-5">
              {/*
                <div>Icons made by <a href="https://www.freepik.com/?__hstc=57440181.678b2868ce77852570c0170da51ea88b.1558195164454.1558195164454.1558195164454.1&__hssc=57440181.8.1558195164454&__hsfp=700819388" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" 			    title="Flaticon">www.flaticon.com</a> is licensed by <a href="http://creativecommons.org/licenses/by/3.0/" 			    title="Creative Commons BY 3.0" target="_blank">CC 3.0 BY</a></div> */}
              <NavLink to="/" ><img src={logo} alt="E-Handy Shop" className="navbar-brand my-icon"/></NavLink>

              <ul className="navbar-nav align-items-center">
                  <li className="nav-item ml-5">
                      <NavLink to="/" className="nav-link">Products</NavLink>
                  </li>
              </ul>

              <NavLink to="/cart" className="ml-auto">
                  <ButtonContainer><span className="mr-2"><i className="fas fa-cart-plus"/></span> My Cart</ButtonContainer>
              </NavLink>
          </NavWrapper>
        );
    }
}
